import React from "react";
import { Container, List, Link } from "../style/header";
import { useNavigate } from "react-router-dom";

const Header = () => {
  return (
    <div>
      <Container>
        <ul>
          <List>
            <li>
              <Link href="">Home</Link>
            </li>
            <li>
              <Link>
                {" "}
                <a
                  onClick={() => {
                    useNavigate("../Login");
                  }}
                >
                  About
                </a>
              </Link>
            </li>
            <li>
              <Link href="">Contact Us</Link>
            </li>
            <li>
              <Link
                onClick={() => {
                  useNavigate("../Login");
                }}
              >
                Login
              </Link>
            </li>
            <li>
              <Link href="">Sign Up</Link>
            </li>
          </List>
        </ul>
      </Container>
    </div>
  );
};

export default Header;
